using Components;using System;using MessagePack;namespace HECSFramework.Core{	[MessagePackObject, Serializable]	public struct WorldSliceIndexComponentResolver : IResolver<WorldSliceIndexComponent>, IData	{		[Key(0)]		public int Index;		public WorldSliceIndexComponentResolver In(ref WorldSliceIndexComponent worldsliceindexcomponent)		{			this.Index = worldsliceindexcomponent.Index;			return this;		}		public void Out(ref IEntity entity)		{			var local = entity.GetWorldSliceIndexComponent();			Out(ref local);		}		public void Out(ref WorldSliceIndexComponent worldsliceindexcomponent)		{			worldsliceindexcomponent.Index = this.Index;		}	}}